const UsersList: FC<Props> = () => {
    const [users, setUsers] = useState<User[]>([])
    useEffect(() => {(async () => {setUsers(await getUsers())})()}, [])
    return (
        <ul>
            {users.map(user => {
                return <li key={user.id}>{user.name}</li>
            })}
        </ul>
    )
}

export default UsersList
